import Nav from './Nav';

const Main = () => {
  return (
    <MainContainer>
      <Nav />
      <MainContent>
        <MainItems>
          <MainH1>Food Delivered to your door</MainH1>
          <MainP>In as less as 15 minutes</MainP>
          <MainBtn>Place Order</MainBtn>
        </MainItems>
      </MainContent>
    </MainContainer>
  );
};

export default Main;
